import React from 'react';
import Navbar from './Navbar';

function App() {
  return (
    <div>
      <Navbar />
      <main>
        <h1>Welcome to Our Restaurant</h1>
        <p>We offer delicious food and excellent service.</p>
        <p>Our menu includes a variety of dishes to satisfy all taste buds.</p>
        <p>Visit us today and experience a culinary journey!</p>
      </main>
      <footer>
        <address>
          123 Main Street, Anytown USA<br />
          Phone: <a href="tel:+11234567890">(123) 456-7890</a> | Email: <a href="mailto:info@ourrestaurant.com">info@ourrestaurant.com</a>
        </address>
      </footer>
    </div>
  );
}

export default App;
